import Navbar from "react-bootstrap/Navbar";
import { Container } from "react-bootstrap";
import OverlayTrigger from "react-bootstrap/OverlayTrigger";
import Tooltip from "react-bootstrap/Tooltip";
import { BsFillCaretUpSquareFill } from "react-icons/bs";
import "./footer.css";

function Footer() {
  return (
<footer className="foot">
        <span >Made with React JS and BootStrap</span>
        <OverlayTrigger key="left" placement="left" overlay={<Tooltip id={`tooltip-left`}>Return to Top</Tooltip>}>
          <BsFillCaretUpSquareFill className="back-up" onClick={(event) => window.open("https://github.com/foofx88", "_blank")} />
        </OverlayTrigger>
        </footer>

  );
}

export default Footer;
